@GavinSelvaratna They should read the poetry of Louise Gluck more, such as “Circe’s Power”:              “I never turned anyone into a pig. 
Some people are pigs; I make them 
Look like pigs.”

To walk is by a thought to go; 
To move in spirit to and fro; 
To mind the good we see; 
To taste the sweet; 
Observing all the things we meet 
How choice and rich they be. — Thomas Traherne, “Walking” https://t.co/V4jLduJI6d

